import React, { Component } from 'react';
import CustomButton from '../../library/CustomButton';
import Header from './Header';


export default class Forgotten extends Component {
    render () {
        return (
            <div>
                <div>
                    <Header/>
                </div>
                <div className='dimeBody'>
                    <div className='dimeBodyTwo'>
                    <h1>Forgotten Password</h1>
                    <h2>Hey, we get it! Sometimes we forget too.</h2>
                    <form>
                        <label for='email'>Email</label>  
                        <input type="email"  placeholder="Enter your email address"/>
                    </form>
                    <CustomButton >Send Password Recovery</CustomButton>
                    <button>Need more help? Contact Us</button>
                    </div>

                </div>
            </div>
        )
    }
}
